class Solution:
    def longestPalindrome(self, s: str) -> str:
        n = len(s)
        dp = [[False] * n for _ in range(n)]
        ans = [0, 0]

        for i in range(n):
            dp[i][i] = True

        for i in range(n - 1):
            if s[i] == s[i + 1]:
                dp[i][i + 1] = True
                ans = [i, i + 1]

        for diff in range(2, n):
            for i in range(n - diff):
                j = i + diff
                if s[i] == s[j] and dp[i + 1][j - 1]:
                    dp[i][j] = True
                    ans = [i, j]

        i, j = ans
        return s[i:j + 1]

class Solution:
    def longestPalindrome(self, s: str) -> str:

        @cache
        def longest_substr_pal(i: int, j: int) -> Tuple[int, int]:
            length = j - i + 1
            is_even = length % 2 == 0
            half = length // 2

            if i == j or (
                is_even and s[i:i+half] == s[j:i+half-1:-1]
            ) or (
                not is_even and s[i:i+half] == s[j:i+half:-1]
            ):
                return i, j

            ignore_left = longest_substr_pal(i + 1, j)
            ignore_right = longest_substr_pal(i, j - 1)
            left_is_bigger = ignore_left[1] - ignore_left[0] > ignore_right[1] - ignore_right[0]

            return ignore_left if left_is_bigger else ignore_right

        i, j = longest_substr_pal(0, len(s) - 1)

        return s[i:j+1]

