class Solution:
    def __init__(self):
        self.ans = 0

    def helper(self, start, requests, indegree, n, count):
        if start == len(requests):
            for i in range(n):
                if indegree[i] != 0:
                    return
            self.ans = max(self.ans, count)
            return

        # Take 
        indegree[requests[start][0]] -= 1
        indegree[requests[start][1]] += 1
        self.helper(start + 1, requests, indegree, n, count + 1)

        # Not-take
        indegree[requests[start][0]] += 1
        indegree[requests[start][1]] -= 1
        self.helper(start + 1, requests, indegree, n, count)

    def maximumRequests(self, n, requests):
        indegree = [0] * n
        self.helper(0, requests, indegree, n, 0)
        return self.ans

class Solution:
    def minimumString(self, a: str, b: str, c: str) -> str:
        strings = sorted((a, b, c))
        result = strings[0]

        for string in strings[1:]:
            length = len(result)
            length_new = len(string)
            overlap_max = min(length_new, length)

            for j in range(0, overlap_max):
                overlap = overlap_max - j 
                if result[-overlap:] == string[:overlap]:
                    result += string[overlap:]
                    break
            else:
                result += string            

        return result

