class Solution:
    def minExtraChar(self, s: str, dictionary: List[str]) -> int:
        chars_count = len(s)

        @cache
        def dp(i: int) -> int:
            chars_left = chars_count - i
            if chars_left == 0:
                return 0

            min_extra_chars = chars_left

            for word in dictionary:
                word_length = len(word)

                if word_length > chars_left or s[i:i+word_length] != word:
                    continue

                if word_length == chars_left:
                    return 0

                min_extra_chars = min(min_extra_chars, dp(i + word_length))

            return min(min_extra_chars, 1 + dp(i + 1))

        return dp(0)

class Solution:
    def trap(self, height: List[int]) -> int:
        left_edge, left_edge_val = -1, -1
        volume, cur_volume = 0, 0
        heights_count = len(height)

        i = 0
        while i < heights_count:
            cur_height = height[i]

            if cur_height < left_edge_val:
                cur_volume += left_edge_val - cur_height
            else:
                left_edge, left_edge_val = i, cur_height
                volume += cur_volume
                cur_volume = 0

            i += 1

            if i == heights_count and cur_volume != 0:
                left_edge, left_edge_val = left_edge + 1, height[left_edge + 1]
                i = left_edge + 1
                cur_volume = 0

        return volume

class Solution:
    def fullJustify(self, words: List[str], maxWidth: int) -> List[str]:
        words_count = len(words)

        def get_line(word_idx: int) -> Tuple[List[str], int]:
            line = []
            line_length = 0

            for i in range(word_idx, words_count):
                word = words[i]
                word_length = len(word)
                if line_length + word_length > maxWidth:
                    break

                line.append(word)
                line_length += word_length + 1 

            return line, line_length

        def create_line(line: List[str], line_length: int, word_idx: int) -> str:
            base_length = line_length - 1
            extra_spaces = maxWidth - base_length

            if len(line) == 1 or word_idx == words_count:
                return " ".join(line) + " " * extra_spaces

            word_count = len(line) - 1
            spaces_per_word = extra_spaces // word_count
            needs_extra_space = extra_spaces % word_count

            for j in range(needs_extra_space):
                line[j] += " "

            for j in range(word_count):
                line[j] += " " * spaces_per_word

            return " ".join(line)

        result = []
        i = 0
        while i < words_count:
            line, line_length = get_line(i)
            i += len(line)
            result.append(create_line(line, line_length, i))

        return result

class Solution:
    def canFinish(self, numCourses: int, prerequisites: List[List[int]]) -> bool:

        nodes = [set() for _ in range(numCourses)]
        for target, required in prerequisites:
            nodes[target].add(required)

        visited = set()

        @cache
        def dfs(course: int) -> bool:
            if course in visited:
                return False

            edges = nodes[course]
            if not edges:
                return True
            if visited & edges:
                return False

            visited.add(course)
            return all(dfs(edge) for edge in edges)

        for course in range(numCourses):
            if not dfs(course):
                return False
            visited.clear()

        return True

