class Solution:
    def minOperations(self, nums: List[int], x: int) -> int:
        length = len(nums)
        queue = [(0, length - 1, x)]
        results_heap = []
        while queue:
            left, right, val = queue.pop()
            if val == 0:
                heappush(results_heap, left + length - 1 - right)
            elif left == right and nums[left] == val:
                heappush(results_heap, length)
            elif left != right and val > 0:
