class Solution:
    def minimumTime(self, n: int, relations: List[List[int]], time: List[int]) -> int:
        graph = defaultdict(list)
        indegree = [0] * n

        for (x, y) in relations:
            graph[x - 1].append(y - 1)
            indegree[y - 1] += 1

        queue = deque()
        max_time = [0] * n
        for node in range(n):
            if indegree[node] == 0:
                queue.append(node)
                max_time[node] = time[node]

        while queue:
            node = queue.popleft()
            for neighbor in graph[node]:
                max_time[neighbor] = max(max_time[neighbor], max_time[node] + time[neighbor])
                indegree[neighbor] -= 1
                if indegree[neighbor] == 0:
                    queue.append(neighbor)

        return max(max_time)

class Solution:
    def minimumTime(self, n: int, relations: List[List[int]], time: List[int]) -> int:
        required = {i: [time[i], set()] for i in range(n)}

        for prev, nxt in relations:
            required[nxt-1][1].add(prev-1)

        max_time = 0

        while required:
            taken = set(course for course in required if len(required[course][1]) == 0)
            for course in taken:
                max_time = max(max_time, required[course][0])
                required.pop(course)

            for course, (_, reqs) in required.items():
                needed = reqs.intersection(taken)
                if needed:
                    required[course][0] += max(time[item] for item in needed)
                    reqs.difference_update(needed)

        return max_time

