func removeNthFromEnd(head *ListNode, n int) *ListNode {
    res := &ListNode{0, head}

    lead := res
    for i := 0; i <= n; i++ {
        lead = lead.Next
    }

    cur := res
    for lead != nil {
        cur = cur.Next
        lead = lead.Next
    }

    cur.Next = cur.Next.Next
    return res.Next
}

func bagOfTokensScore(tokens []int, power int) int {
    n := len(tokens)
	sort.Ints(tokens)
	res := 0

	l := 0
	r := n - 1

	for l <= r {
		for l <= r && power >= tokens[l] {
			power -= tokens[l]
			l++
			res++
		}

		if res == 0 {
			break
		}

        if r - l + 1 <= 2 {
			break
		}

		power += tokens[r]
		r--
		res--
	}

	return res
}

func minimumLength(s string) int {
    left := 0
    right := len(s) - 1

    for left < right {
        lc := s[left]
        rc := s[right]

        if lc != rc {
            return right - left + 1
        }

        for left + 1 < right && lc == s[left + 1] {
            left++
        }

        for left < right - 1 && rc == s[right - 1] {
            right--
        }

        right--
        left++
    }

    return right - left + 1
}
